import React from "react";

const Header = () => {
    return (
        <div className="header-conteiner">
            <a class="active" href="#home">Home</a>
            <a href="#news">Portfolio</a>
            <a href="#contact">Contact</a>
            <a href="#about">About</a>
        </div>
    );
};

export default Header;
